import React from "react";
import Navbar from "../components/navbar";
import "./prevent.css";
import {Image} from 'react-bootstrap';
const Prevent = () => {
  return (
    <div>
      <Navbar />
      <h1>รู้ไว้ไม่โดนโกง</h1>
      <div className="row">
        <div className="column">
          <img src="/logo11.png" className="image" />
        </div>
        <div className="column">
          <img src="/logo11.png" className="d-inline-block align-top img" />
        </div>
        <div className="column">
          <img src="/logo11.png" className="d-inline-block align-top img" />
        </div>
      </div>
    </div>
  );
};

export default Prevent;
